import React, { useState, useEffect } from "react";

const StudentMarks = () => {
  const [studentMarks, setStudentMarks] = useState(null);

  useEffect(() => {
    // Sample data fetched
    const fetchedData = [
      {
        id: 1,
        studentId: 3,
        semester: "Semester 1",
        marks: '{"Mathematics":"23","Physics":"23","Chemistry":"23"}',
      },
    ];

    // Parse the marks JSON string into an object
    const parsedMarks = JSON.parse(fetchedData[0].marks);

    setStudentMarks({
      semester: fetchedData[0].semester,
      marks: parsedMarks,
    });
  }, []);

  if (!studentMarks) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{studentMarks.semester}</h1>
      <table border="1">
        <thead>
          <tr>
            <th>Subject</th>
            <th>Marks</th>
          </tr>
        </thead>
        <tbody>
          {Object.keys(studentMarks.marks).map((subject) => (
            <tr key={subject}>
              <td>{subject}</td>
              <td>{studentMarks.marks[subject]}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default StudentMarks;
